import PickList from 'component/column/pickList';
import { VFC } from 'react';
import styled from "styled-components";

const RecordEntryForm: VFC = () => {

    const columns = [
        {
            label: '釣れた魚',
            select:{
                id: 'caughtFish',
                name: 'caughtFish'
            },
            options: [{
                    value: 'aji',
                    text: 'アジ',
                },
                {
                    value: 'buri',
                    text: 'ブリ',
                },
                {
                    value: 'kasago',
                    text: 'カサゴ',
                },
                {
                    value: 'tachiuo',
                    text: 'タチウオ',
                },
                {
                    value: 'haze',
                    text: 'ハゼ',
                }
        ],
        multiple: true,
        required: true,
        }
    ]

    return (
        <>
            {columns.map((c)=>(
                <PickList label={c.label} select={c.select} options={c.options}></PickList>
            ))}
        </>
    )
}

export default RecordEntryForm;
